import React from 'react';
import './About.css';
import frontendIcon from '../media/code.svg';
import backendIcon from '../media/terminal.svg';
import bracketsIcon from '../media/brackets.svg';


const About = () => {
  return (
    <div class="bg-black-80 ">
      <div class="mw9 center ph3-ns">
        <div class="cf ph2-ns">
          <section class="mw5 mw7-ns center  pa3 ph5-ns">
            <h1 class="mt0">Centered Container</h1>
            <p class="lh-copy measure">
              Combine width or max-width values with the center class to create a centered
              container for your content.
            </p>
          </section>

        </div>
      </div>
    </div>
  )
}

export default About;
